import React from 'react';
import { Row, Col } from 'react-bootstrap';
import Product from '../components/Product';
import products from '../products';
import { Card } from "react-bootstrap";
import { Link } from "react-router-dom";

const HomeScreen = () => {
    return (
        <>
            <div className="container text-center">
                <Row className="justify-content-center">
                    <Col md={4}>
                        <Card className="my-3 p-3 rounded" style={{ backgroundColor: "#686868", fontFamily: 'MinuUusFont' }}>
                            <Card.Body>
                                <Card.Title as="h3">Tere tulemast</Card.Title>
                                <Card.Text>Tere tulemast meie veebilehele!</Card.Text>
                            </Card.Body>
                        </Card>
                    </Col>
                </Row>
            </div>

            <Row>
                {products.map((product) => (
                    <Col key={product._id} sm={12} md={4} lg={4} xl={4}>
                        <Product product={product} />
                    </Col>
                ))}
            </Row>
        </>
    );
};

export default HomeScreen;
